import React from 'react';
import { useForm } from 'react-hook-form';

export default function ItemInput() {
  const { register, handleSubmit, errors } = useForm();
  const onSubmit = data => console.log(data);
  console.log(errors);
  
  return (
    <form onSubmit={handleSubmit(onSubmit)}>
      <input type="text" placeholder="name" name="name" ref={register({required: true, maxLength: 80})} />
      <select name="realm" ref={register({ required: true })}>
        <option value="Earth">Mr</option>
        <option value="Celestial">Mrs</option>
        <option value="Both">Miss</option>
      </select>
      <input type="undefined" placeholder="expires" name="expires" ref={register} />
      <input type="undefined" placeholder="magical" name="magical" ref={register} />
      <input type="undefined" placeholder="number" name="number" ref={register} />
      <input type="undefined" placeholder="charges" name="charges" ref={register} />
      <input type="undefined" placeholder="chargeLikeDetail" name="chargeLikeDetail" ref={register} />
      <input type="undefined" placeholder="details" name="details" ref={register} />
      <input type="undefined" placeholder="writtenBy" name="writtenBy" ref={register} />
      <input type="undefined" placeholder="dateWritten" name="dateWritten" ref={register} />
      <input type="undefined" placeholder="formalSpaceTotal" name="formalSpaceTotal" ref={register} />
      <input type="undefined" placeholder="formalSpaceRemaining" name="formalSpaceRemaining" ref={register} />
      <input type="undefined" placeholder="lastplayer" name="lastplayer" ref={register} />

      <input type="submit" />
    </form>
  );
}
